import Link from 'next/link';

const TopMenu = () => {
	return (
		<div className="menu">
		   <div class="menu-item active" data-label="Bestsellers"><span>BESTSELLERS</span></div>
		   <div class="menu-item hide" data-label="Veg Pizza"><span>VEG PIZZA</span></div>
		   <div class="menu-item hide" data-label="Non-Veg Pizza"><span>NON-VEG PIZZA</span></div>
		   <div class="menu-item hide" data-label="Pizza Mania"><span>PIZZA MANIA</span></div>
		   <div class="menu-item hide" data-label="Sides"><span>SIDES</span></div>
		   <div class="menu-item hide" data-label="Beverages"><span>BEVERAGES</span></div>
		   <div class="menu-item hide" data-label="Dessert"><span>DESSERT</span></div>
		</div>
	);
};

export default TopMenu;
